// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="header">
      <h1>Eva Lau</h1>
      <p>Eva Lau is an artist that loves printmaking, textiles, and paint. But mainly, she just likes making things.</p>
    </div>
  );
}

export default App;
